webpackJsonp([0xb001b7d037de],{4506:function(e,t){e.exports={data:{markdownRemark:{html:'<p>Linting is the process of running a program that analyzes your code for programmatic and stylistic errors. A linting tool, or a linter, marks or flags any potential errors in your code such as syntax errors or incorrectly spelled variable names. This can save time and help you write better code.</p>\n<p>Linters can be installed using <code>npm</code> or another package manager. Linters can be used from the command line by passing in files. Linters are also available as plugins for tools and sometimes they are directly integrated into editors.</p>\n<p>Here are some popular Javascript Linters:</p>\n<p><a href="http://www.javascriptlint.com/online_lint.php">JSLint</a> </p>\n<p><a href="http://jshint.com">JSHint</a> </p>\n<p><a href="http://jscs.info">JSCS</a> </p>\n<p><a href="http://eslint.org">ESLint</a></p>\n<h4>Linters for Editors :</h4>\n<ul>\n<li>Visual Code : To Install the eslint extension, open command palette (View -> Command Palette.. or cmd+shift+p ) and execute command:\next install eslint</li>\n</ul>\n<h4>Tools and Plugins</h4>\n<p><a href="https://prettier.io">Prettier</a></p>',fields:{slug:"/javascript/code-linting-in-javascript/"},frontmatter:{title:"Code Linting"}}},pathContext:{slug:"/javascript/code-linting-in-javascript/"}}}});
